import React from 'react';

import SearchBar from './SearchBar';

const App = () => {

    const searchAction = (term) => {
        console.log(term);
    }

    return (
        <div className="ui container" style={{ marginTop: '20px' }} >
            <SearchBar submithandler={searchAction} />
        </div>
    )
}


export default App;
